import React, { useState } from "react";

const App = () => {
    let newTime = new Date().toLocaleTimeString();

    const[currTime, setTime] = useState(newTime);

    const uTime = () => {
        let newTime = new Date().toLocaleTimeString();
        setTime(newTime);
    }
    
    return (
        <>
            <h1>{newTime}</h1>
            <button onClick={uTime}>Get Time</button>
        </>
    );
}

export default App;
